def maxProduct(words):
    if not words:
        return 0
    length=len(words)
    num_words=[]
    for w in words:
        _sum=0
        for c in w:
            _sum|=1<<(ord(c)-97)
        num_words.append(_sum)
    _max=0
    for i in range(1,length):
        for j in range(i):
            if not num_words[i]&num_words[j]:
                _max=max(_max,len(words[i])*len(words[j]))
    return _max


